import { TextField } from "@material-ui/core";
import React from "react";
export default function CustomInput(
  label,
  variant,
  onChange,
  name,
  value,
  ...others
) {
  return (
    <TextField
      label={label}
      variant={variant || "outlined"}
      onChange={onChange}
      name={name}
      value={value}
      {...others}
      fullWidth
    />
  );
}
